import styles from "./Cart.module.css";

import Card from "../UI/Card/Card";
import MealItem from "../Meals/MealItem/MealItem";

const Cart = (props) => {
  return (
    <Card>
      <MealItem className={styles["cart-items"]} />
    </Card>
  );
};

export default Cart;
